Tokie sugedę, jie daro šlykščius darbus;
nėra nė vieno, kuris darytų gera.

3.verse:
Visi nuklydę, visi panašiai sugedę;
nėra nė vieno, kuris darytų gera,
nė vienui vieno.

17.verse:
Jis ištiesė ranką iš aukštybių
ir paėmė mane;
jis ištraukė mane iš galingų vandenų.

7.verse:
Iš vieno dangaus skliauto galo ji pradeda žygį,
o jos kelias veda prie kito galo;
nuo jos kaitros pasislėpti niekas negali.

9.verse:
VIEŠPATIES įstatai teisūs;
jie džiugina širdį;
VIEŠPATIES įsakymas aiškus;
jis teikia akims šviesos.

15.verse:
Esu lyg ant žemės išlietas vanduo;
visi mano kaulai išnarstyti;
lyg vaškas mano širdis, ištirpusi krūtinėje.

17.verse:
Šunys mane apgula iš visų pusių,
nedorėlių gauja mane apspinta;
jie žeidžia man rankas ir kojas

