11.verse:
Mano gyvenimą sekina skausmas,
o mano metus – dejonės;
nuo kančios man stinga jėgų.

16.verse:
Tavo rankose mano likimas;
gelbėk mane nuo priešų, nuo tų,
kurie mane persekioja.

