jis nesikreipia į pagonių stabus
ar netikrų dievų garbintojus.

10.verse:
Didžiojoje sueigoje skelbiau tavo išganymo rūpestį,
netramdžiau savo lūpų;
tu, VIEŠPATIE, tai turi žinoti.

13.verse:
Mane supa nesuskaičiuojami vargai,
