5.verse:
Guliu kniūbsčias tarp priešų lyg ryjančių liūtų;
jų dantys – ietys ir strėlės,
o jų liežuviai – aštrūs kalavijai.

7.verse:
Jie paspendė pinkles po mano kojomis,
norėdami mane pagauti;
jie man iškasė duobę, bet patys į ją įkrito. Sela.

8.verse:
Mano širdis ištikima, Dieve;
mano širdis ištikima;
giedosiu ir šlovinsiu tave!

