Pasaulį jis padarė tvirtą, nepajudinamą;
tautas jis teis bešališkai.

7.verse:
Sugėdinami visi drožinių garbintojai,
kurie didžiuojasi savo beverčiais stabais;
visi dievai puola prieš jį kniūbsti.

3.verse:
