nekęsiu žmogaus, kuris suktai elgiasi,
nieko bendra su juo neturėsiu.

6.verse:
Akimis ieškau krašte Dievui ištikimų žmonių,
kad jie gyventų su manimi;
kas laikosi doro kelio, tas bus mano tarnyboje.

